import React, { useState } from "react";
import universityData from "./UniversityData";
import jsPDF from "jspdf";
import "jspdf-autotable";

function App() {
  const [selectedUniversity, setSelectedUniversity] = useState(universityData[0]);
  const [selectedSubject, setSelectedSubject] = useState(universityData[0].subjects[0]);
  const [selectedProgram, setSelectedProgram] = useState("Bachelors");

  const selectedSubjectData =
    selectedUniversity.subjectDetails[selectedSubject]?.[selectedProgram];

  const gpaCutoff = parseFloat(selectedSubjectData?.gpaCutoff?.value);
  const satCutoff = parseInt(selectedSubjectData?.satCutoff?.value);

  const generatePDF = () => {
    const doc = new jsPDF();
    doc.text("University Program Details", 20, 10);

    const rows = [
      ["University", selectedUniversity.name],
      ["Subject", selectedSubject],
      ["Program", selectedProgram],
      ["QS Rankings Over Years", selectedSubjectData?.qsRankingsOverYears.join(", ")],
      ["Start Date", selectedSubjectData?.startDate],
      ["Fees", selectedSubjectData?.fees],
      ["GPA Cutoff", `${selectedSubjectData?.gpaCutoff?.value} (${selectedSubjectData?.gpaCutoff?.note})`],
      ["SAT Cutoff", `${selectedSubjectData?.satCutoff?.value} (${selectedSubjectData?.satCutoff?.note})`],
      ["Eligibility (International)", selectedSubjectData?.eligibility?.International],
      ["Eligibility (Domestic)", selectedSubjectData?.eligibility?.Domestic],
      ["Course Link", selectedSubjectData?.courseLink],
    ];

    doc.autoTable({
      head: [["Field", "Value"]],
      body: rows,
    });

    doc.save("University_Program_Details.pdf");
  };

  return (
    <div className="App" style={{ padding: "20px" }}>
      <h1>QS World University Rankings</h1>

      <label>
        Select University:
        <select
          value={selectedUniversity.name}
          onChange={(e) =>
            setSelectedUniversity(
              universityData.find((u) => u.name === e.target.value)
            )
          }
        >
          {universityData.map((university) => (
            <option key={university.name} value={university.name}>
              {university.name}
            </option>
          ))}
        </select>
      </label>

      <br />

      <label>
        Select Subject:
        <select
          value={selectedSubject}
          onChange={(e) => setSelectedSubject(e.target.value)}
        >
          {selectedUniversity.subjects.map((subject) => (
            <option key={subject} value={subject}>
              {subject}
            </option>
          ))}
        </select>
      </label>

      <br />

      <label>
        Select Program:
        <select
          value={selectedProgram}
          onChange={(e) => setSelectedProgram(e.target.value)}
        >
          <option value="Bachelors">Bachelors</option>
          <option value="Masters">Masters</option>
          <option value="PhD">PhD</option>
        </select>
      </label>

      {selectedSubjectData && (
        <div>
          <h2>Program Details</h2>
          <p>
            <strong>QS Rankings (last 5 years):</strong>{" "}
            {selectedSubjectData.qsRankingsOverYears.join(", ")}
          </p>
          <p>
            <strong>Start Date:</strong> {selectedSubjectData.startDate}
          </p>
          <p>
            <strong>Fees:</strong> {selectedSubjectData.fees}
          </p>
          <p>
            <strong>GPA Cutoff:</strong>{" "}
            {selectedSubjectData.gpaCutoff?.value}{" "}
            <em>({selectedSubjectData.gpaCutoff?.note})</em>
          </p>
          <p>
            <strong>SAT Cutoff:</strong>{" "}
            {selectedSubjectData.satCutoff?.value}{" "}
            <em>({selectedSubjectData.satCutoff?.note})</em>
          </p>
          <p>
            <strong>Eligibility (International):</strong>{" "}
            {selectedSubjectData.eligibility?.International}
          </p>
          <p>
            <strong>Eligibility (Domestic):</strong>{" "}
            {selectedSubjectData.eligibility?.Domestic}
          </p>
          <p>
            <strong>Course Link:</strong>{" "}
            <a
              href={selectedSubjectData.courseLink}
              target="_blank"
              rel="noopener noreferrer"
            >
              View Course
            </a>
          </p>
          <button onClick={generatePDF}>Download PDF</button>
        </div>
      )}
    </div>
  );
}

export default App;
